var store;

Vue.use(Vuex);

store = new Vuex.Store({
  state: {
    edit_state: 0
  },
  mutations: {
    PATCH_EDIT: function(state) {
      return state.edit_state = 1;
    },
    START_EDIT: function(state) {
      return state.edit_state = 2;
    },
    END_EDIT: function(state) {
      return state.edit_state = 0;
    }
  }
});

